import data from "../mock-data.json";

export const Table = () => {
  const [workouts, setWorkout] = React.useState(data);
  const renderTableData = () => {};

  return (
    <div className="table-container">
      <table className="center">
        <thead>
          <tr>
            <th>Exercise</th>
            <th>Sets</th>
            <th>Reps</th>
          </tr>
        </thead>
        <tbody>
          {workouts.forEach((element) => {
            console.log("workouts", workouts.exercises);
            {
              element.exercises.forEach((index) => {
                console.log(index.exerciseName);
              });
            }
          })}
        </tbody>
      </table>
    </div>
  );
};
